import java.util.*;
import java.io.*;

class  Main {
    public static void main(String[] args) {
        StringBuilder sb = new StringBuilder();
        Scanner sc = new Scanner(System.in);
        int n = sc.nextInt();
        int[] powers = new int[n];
        int[] magicCrystal = new int[n];
        for (int i = 0; i < n; i++) {
            powers[i] = sc.nextInt();
        }
        for (int i = 0; i < n; i++) {
            magicCrystal[i] = sc.nextInt();
        }
        Map<Integer, MagicCrystal> map = new HashMap<>();

        long[] moves = new long[n];
        long[] maximums = new long[n];
        moves[0] = 0;
        maximums[0] = powers[0];
        map.put(magicCrystal[0], new MagicCrystal(0, 0));
        for (int i = 1; i < n; i++) {
            if (map.get(magicCrystal[i]) == null) {
                moves[i] = moves[i - 1] + 1;
                maximums[i] = maximums[i - 1] + powers[i];
            } else {
                MagicCrystal crystal = map.get(magicCrystal[i]);
                if (moves[i - 1] + 1 < crystal.steps + 1) {
                    moves[i] = moves[i - 1] + 1;
                    maximums[i] = maximums[i - 1] + powers[i];
                } else if (moves[i - 1] + 1 > crystal.steps + 1) {
                    moves[i] = crystal.steps + 1;
                    maximums[i] = maximums[crystal.preIndex] + powers[i] - (i - crystal.preIndex);
                } else {
                    moves[i] = moves[i - 1] + 1;
                    maximums[i] = Math.max(maximums[crystal.preIndex] + powers[i] - (i - crystal.preIndex),
                            maximums[i - 1] + powers[i]);
                }
            }
            map.put(magicCrystal[i], new MagicCrystal(i, moves[i]));
        }
        System.out.println(moves[n - 1] + " " + maximums[n - 1]);

    }

    public static class MagicCrystal {
        int preIndex;
        long steps;

        public MagicCrystal(int index, long steps) {
            this.preIndex = index;
            ;
            this.steps = steps;
        }
    }
}
